	work_year INT,
	experience CHAR(2),
	company_location CHAR(2),
	salary REAL,
	remote_ratio INT,
	company_size CHAR(1),
	employee_residence CHAR(2),
	job_title VARCHAR(100),
	employment_type CHAR(2)
);

